#include<bits/stdc++.h>
using namespace std;

const int MAX = 200001;
int arr[MAX] = {false};

int main()
{
    int n, x;
    cin >> n;

    for (int i = 0; i < n; i += 1) {
        cin >> x;
        arr[x] += 1;
    }

    int mx = -1, index = -1;
    for (int i = 0; i < MAX + 1; i += 1) {
        if (mx < arr[i]) {
            mx = arr[i];
            index = i;
        }
    }

    cout << index;

    return 0;
}
